import "./style.css";

const Footer = () => {
  return (
    <footer>
      <p>Representante: María Liaño</p>
      <a href="http://www.eboracast.com/" target="_blank" rel="noreferrer">
        www.eboracast.com
      </a>
      <a href="mailto: maria@eboracast.com">maria@eboracast.com</a>
    </footer>
  );
};
export default Footer;
